import React, { Component } from 'react';
import './App.css';
import Todo from './Todo';
import NewTodo from './NewTodo';

class App extends Component {
  render() {
    return (
        <div className="App">
          <h1>ToDo App</h1>
          <Todo></Todo>
        </div>
    );
  }
}

export default App;
